import Carousel from "react-bootstrap/Carousel";

const CaruselCards = () => {
  const Cards = [
    {
      id: 1,
      name: "Shtepia ne Prishtin",
      description:
        "Three-storey villa for sale, coht simple f surrounded by a green belt. The condition is very well maintained invested wisely. You are welcome for a visit. ",
      img: "https://luxury-houses.net/wp-content/uploads/2020/06/Harbor-Contemporary-House-in-Tampa-Florida-by-DSDG-Architects-1.jpg",
    },
    {
      id: 2,
      name: "Shtepia ne Prizren",
      description:
        "A house is a single-unit residential building. It may range in complexity from a rudimentary hut to a complex structure of wood, masonry, concrete ",
      img: "http://static1.squarespace.com/static/54e8ff62e4b0440df7a42b7a/t/5d7c22a3478b13088d59a6d3/1664516682215/4.jpg?format=1500w",
    },
  
  ];
  return (
    <Carousel variant="dark" className="Caruselcards">
    <Carousel variant="dark" className="Caruselcards">
        <Carousel.Item>
            <img src="https://cdn.pixabay.com/photo/2015/04/23/22/00/tree-736885__480.jpg" alt="hello" className="hello"/>
            <img src="https://cdn.pixabay.com/photo/2015/04/23/22/00/tree-736885__480.jpg" alt="hello" className="hello"/>
            <img src="https://cdn.pixabay.com/photo/2015/04/23/22/00/tree-736885__480.jpg" alt="hello" className="hello"/>
            <img src="https://cdn.pixabay.com/photo/2015/04/23/22/00/tree-736885__480.jpg" alt="hello" className="hello"/>
          <Carousel.Caption>
            <h5>First slide label</h5>
            <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
          </Carousel.Caption>
        </Carousel.Item>
        <Carousel.Item>
            <img src="https://cdn.pixabay.com/photo/2015/04/23/22/00/tree-736885__480.jpg" alt="hello" className="hello"/>
            <img src="https://cdn.pixabay.com/photo/2015/04/23/22/00/tree-736885__480.jpg" alt="hello" className="hello"/>
            <img src="https://cdn.pixabay.com/photo/2015/04/23/22/00/tree-736885__480.jpg" alt="hello" className="hello"/>
            <img src="https://cdn.pixabay.com/photo/2015/04/23/22/00/tree-736885__480.jpg" alt="hello" className="hello"/>
          <Carousel.Caption>
            <h5>First slide label</h5>
            <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
          </Carousel.Caption>
        </Carousel.Item>
    </Carousel>

    </Carousel>
    
  );
};

export default CaruselCards;
